import React from "react";

const Modal = (props) =>{
  return(
    <div className="modal">
      <p>Are you sure</p>
      <button className="btn btn--alt" onClick={props.click}>Cancel</button>
      <button className="btn" onClick={props.click}>Confirm</button>
    </div>
    
  );
};

export default Modal;
